import Additem from "./Additem";
import Budd from "./Budd";
import Cond from "./Cond";
import Naal from "./Naal";
import { useState } from "react";



const submit=(e)=> {
  console.log("submitted")
}
const [newItem,setNewItem]=useState('')
function App() {
  return (
   <div className="App">
      <Budd/>
      <Additem
          newItem={newItem}
          setNewItem={setNewItem}
          submit={submit}
      />
      <Cond/>
      <Naal/>
      </div>
  );
}
export default App;
